(35, 800545996069324, 'Ready2Succeed', 'Program', 'Our Ready2Succeed workforce development programs provide valuable training, job experience and references, as well as the opportunity to earn and save wages for permanent housing. Participants no longer struggle with life-altering addictions or behavior and are motivated to achieve independent employment.  For more information download the Men’s Ministry Brochure.\n\nhttps://www.missiondc.org/wp-content/uploads/2019/07/men_programs_brochure_2019-7.pdf', '726173106231202', '759682631849783,754621632893339,902951823980164,945841786673442,1154397851156755,886267440482873', NULL, NULL, '2020-07-01 05:27:11', '2020-07-01 05:27:11'),
(36, 761929300455945, 'Heyman Interages Center', 'Program', 'The JCA Heyman Interages® Center intergenerational programs have brought children and older adults together for 30 years. Since 1986, approximately 45,000 children and older adults in more than 100 schools and senior facilities have benefited from participation in our programs. Over the years hundreds of dedicated and caring older adult volunteers, who are the heart of Interages, have made a significant difference in the lives of children.', NULL, '1282487813090005,1147690047097756,616047069998063,993493444765030,1141624870158332', NULL, NULL, '2020-07-01 05:27:11', '2020-07-01 05:27:11'),
(37, 777455803391753, 'Housing Resource Center', 'Program', 'Our walk-in Domestic Violence Resource Clinic takes place every Wednesday from 1:00pm-3:30pm at the Westminster Presbyterian Church on 400 I St SW, DC (near Waterfront metro). With the DC Volunteer Lawyers Project and My Sisters Place, we provide victims access to housing assistance, legal assistance, and counseling.\n\nThe Housing Resource Center (HRC) is the hub of DASH’s efforts to prevent homelessness among domestic violence survivors. We assist survivors in completing housing applications, obtaining safety transfers, navigating the public housing system, and making connections to community services. Survivors can conduct housing searches in our computer lab and work one-on-one with Housing Specialists.\n\nOur Housing Resource Center Online is a web-based information clearinghouse with comprehensive information on housing programs for women, including details on admission processes, eligibility requirements, and accessibility for people with disabilities.', '983721114373124', '1140920920771303,1195066035930824,765385785732538,577584068562238', '828792720206018', NULL, '2020-07-01 05:27:11', '2020-07-01 05:27:11'),
