(1, '1594328932.png', 'Community Resource Exchange', NULL, '<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The DC Community Resource Inventory is a project of the DC Community Resource Information Exchange (DC CoRIE) Initiative.&nbsp;</span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span id=\"docs-internal-guid-74dba194-7fff-5e13-40e1-13b1ea2fdb29\"><br></span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Produced by the DC Primary Care Association, in partnership with the Open Referral Initiative, with technology development by Sarapis, this is a \'proof of concept\' of a functional Community Resource Inventory containing information about health, human, and social services available to DC residents in need.&nbsp;</span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">This website is a reference implementation for the underlying database. This database is also available via an Application Programming Interface, which can be accessed at our Developer Portal here.</span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To suggest edits or additions to this directory, reach out to David Poms at the DCPCA.</span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To learn more about the Open Referral Initiative, reach out to <a href=\"mailto:Greg@openreferral.org\" target=\"_blank\">Greg Bloom</a>.</span></p>', '<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The DC Community Resource Inventory is a project of the DC Community Resource Information Exchange (DC CoRIE) Initiative.&nbsp;</span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">Produced by the DCPCA, in partnership with the Open Referral Initiative, with technology development by Sarapis, this is a \'proof of concept\' of a functional Community Resource Inventory containing information about health, human, and social services available to DC residents in need.&nbsp;</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span id=\"docs-internal-guid-74dba194-7fff-5e13-40e1-13b1ea2fdb29\"><br></span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p>', '/uploads/images/1595338162_part2.png', '<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; text-align: center; white-space: pre-wrap;\">This website is a reference implementation for the underlying database. This database is also available via an Application Programming Interface, which can be accessed at our Developer Portal here.</span><br></p>', '/uploads/images/1593798060_part3.png', '<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To suggest edits or additions to this directory, reach out to David Poms at the DCPCA.</span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To learn more about the Open Referral Initiative, reach out to <a href=\"mailto:Greg@openreferral.org\" target=\"_blank\">Greg Bloom</a>.</span></p>', '/uploads/images/1593798060.png', 'See information that is incorrect or needs to be updated?', NULL, 'Find local resources that are right for you.', 'Suggest a Change', 'http://orservices.sarapis.org/suggest/create', '<p style=\"text-align: center; \"> Community Resource Exchange</p>', '1599793837_part1.png', NULL, 'orservices.sarapis.org', 'Community Resource Exchange - orservices.sarapis.org', '0', '1', '0', '#50c9ce', '#50aed3', '#1973c8', '#ee2e31', '#003db8', '#1973c8', '#ffffff', '#ffffff', '#50c9ce', 1, 'South Dade Only', 'All Services', '1577102338.png', '1577102281.jpg', '0', '<p>Welcome! This is the login page.</p>', '<p>Welcome! This is the register page. </p>', 1, 'Services (ex. larable-dev.sarapisorg)', 0, 0, 0, 0, 0, NULL, '2020-10-15 13:51:29');
