INSERT INTO `organizations` (`id`, `organization_recordid`, `organization_name`, `organization_alternate_name`, `organization_logo_x`, `organization_x_uid`, `organization_description`, `organization_email`, `organization_forms_x_filename`, `organization_forms_x_url`, `organization_url`, `organization_status_x`, `organization_status_sort`, `organization_legal_status`, `organization_tax_status`, `organization_tax_id`, `organization_year_incorporated`, `organization_services`, `organization_phones`, `organization_locations`, `organization_contact`, `organization_details`, `organization_tag`, `organization_airs_taxonomy_x`, `flag`, `organization_website_rating`, `created_at`, `updated_at`) VALUES
(2, 597291118069880, 'Eldercare Organization', NULL, NULL, NULL, 'Grounded in grassroots senior leadership, Eldercare Organization mobilizes a committed corps of volunteers to reach out to isolated inner-city seniors with free services, advocacy, and companionship, building a network of caring eyes and ears that enables at-risk seniors to age in place. More than simply a social service provider,Eldercare Organizationis a bold experiment in building caring, just and inclusive community.', 'info@EldercareOrganization.org', NULL, NULL, 'https://www.EldercareOrganization.org/', NULL, '4', NULL, NULL, NULL, NULL, '1229834582759480', '585670788788642', '903036719647021', '0', NULL, NULL, NULL, NULL, NULL, '2020-07-01 05:27:01', '2020-10-15 05:01:47'),
(33, 640186123610411, 'Park Activity Organization', NULL, NULL, NULL, 'We are the regional hub for activating public lands & waters for broad community revitalization – through partnership, innovation, discovery, and workforce development. Our mission is to grow city-wide park-based community health & vitality by nurturing innovation & partnerships.\r\n\r\nWe lead greening initiatives across the city – massive land reclamation, native reforestation, watershed restoration, public health and fitness programming, urban agriculture, and green job training &mdash; to help revitalize our parks and work for justice alongside our local communities.', 'example@sample.org', NULL, NULL, 'https://examplewebsite.com/', NULL, '4', NULL, NULL, NULL, NULL, '579430499829276,1237806236278461', '1126250650450819,1198829430756347', '938406735971229,1052806219928789,1133664511724903,793256928193231', '0', NULL, NULL, NULL, NULL, NULL, '2020-07-01 05:27:02', '2020-10-13 15:23:25'),
(62, 786390431879533, 'COMMUNITY FAMILY LIFE', 'CFL', NULL, NULL, 'This program offers housing up to two-years, with 13 individual units, offering a stable and supportive housing program. These spacious one, two and three-bedroom, private apartments are available to help families escape homelessness and enable each family group to work towards independence and self-sufficiency.', 'info@testingtest.com', NULL, NULL, 'http://www.sampleorg.org', NULL, '4', 'Nonprofit', '501.c.3', '234-2323-23', '1999', '799762672906525', NULL, '1266854743896634', '0', NULL, NULL, NULL, NULL, '2', '2020-07-01 05:27:02', '2020-10-14 15:47:58'),
(101, 906742630902911, 'Your Community Center', 'YCC', NULL, NULL, 'Your Community Center offers safe, affordable housing and clinical life skills training for men and women with mental illness, empowering them to work at their own pace toward recovery and greater independence. Residents receive 24/7 care and supervision they need as they progress through the recovery process. Our continuum of care allows someone in crisis to enter our program, become stable, transfer to a group living situation and hopefully progress to a supported independent living apartment.\r\n\r\nExact addresses for various programs are not listed.', 'sample@sampleorg.org', NULL, NULL, 'http://samplewebsite.org', NULL, '4', 'Nonprofit', '501.c.3', '23-23-2356', '1920', '590149106022184,574661829122399,626861523724993,1229115016596631', '753558713598997', '1318861728823017', '1.1700895166391E+51', NULL, NULL, NULL, NULL, '3', '2020-07-01 05:27:02', '2020-10-14 16:07:53'),
(116, 925360037107607, 'Women\'s Organization', 'Women\'s Group', NULL, NULL, 'Our case management services are a part of a comprehensive family-centered program that provides peer support, creates connections between careseekers and caregivers, and promotes the participation and empowerment of women, their families, and members of their support network in developing care plans based on their self-defined needs. We accept, as well as provide, referrals for women, women and their children, to/from other programs that provide local primary medical care, support and mental health services for women with HIV/AIDS either currently not in a system of care or who need support to remain in a system of care. We provide services for women and their families that assists them in accessing respite care, childcare, housing, food, transportation services, etc., providing women with opportunities to take care of not only their own primary medical and psychosocial needs but also the needs of their children and other family members.', 'sample@sample.org', NULL, NULL, 'https://www.facebook.com/womensgroup', NULL, '4', 'Nonprofit', '501c3', 'xx-xxxxxxxx', '2008', '914835976451142,1124462892366916,1301959132503150', '640736255097589', '946396771118356', '0', NULL, NULL, NULL, NULL, NULL, '2020-07-01 05:27:02', '2020-10-13 15:22:02'),
(171, 1183850219079477, 'Faith to Faith Community Organization', 'Faith to Faith', NULL, NULL, 'our Single Family Home Repair Program brings skilled workers and volunteer groups into area homes. Over the course of many months, a home\'s plumbing, electrical, drywall, and other infrastructure repairs are made. Yachad requires homeowners to participate in our Homeowner Education Workshops to learn home maintenance and financial planning skills. \r\n\r\nAdditionally, Our Faith to Faith Community Development Program brings together real estate professionals to provide expertise to community development projects by working in partnership with houses of worship and other nonprofits to renovate their community facilities to better serve the congregants and neighborhood residents.', 'info@sampleorg.org', NULL, NULL, 'http://sampleorg.org/', NULL, '4', NULL, NULL, NULL, NULL, '1124787894447866,1258855549014937', '896191474881929', '888398891117437', '0', NULL, NULL, NULL, NULL, NULL, '2020-07-01 05:27:02', '2020-10-13 15:19:04');
