(11, 590149106022184, 'Example House Program', NULL, '906742630902911', 'Located in a quiet, residential neighborhood, this program is a long-term group home for eight men and women with mental illness who are at great risk of homelessness. The program is within easy walking distance to public transportation and stores. Program residents receive continuing clinical support services from Your Community Center as they integrate into the community, participating in individual day programs, full or part-time jobs and volunteer programs.', '', 'https://sampleorg.org', NULL, 'Verified', '929094559121639', 'Referrals are accepted from the Department of Behavioral Health, Local Service Agencies, private providers, hospitals and families.\r\n\r\nResidents must be formerly homeless, be enrolled with the Department of Behavioral Health, and have a recommendation from their Agency to apply to Holly House. The  Agency will inform them of any needed documentation that they require.\r\n\r\nBecoming a resident includes receiving meals, 24-hour residential staff supervision and support services to enable clients to achieve greater independence.\r\n\r\nPlease contact Supervisor for information about how to enter', NULL, NULL, NULL, NULL, '1346383381421901,', NULL, '1328428091308059', '', NULL, NULL, NULL, NULL, NULL, '2020-07-01 05:26:43', '2020-10-12 22:54:46'),
(33, 574661829122399, 'Your Community Shelter', NULL, '906742630902911', 'Your Community Shelter is an eight-bed emergency shelter and crisis stabilization for people experiencing acute mental illness. One of only two private crisis homes in the city, its therapeutic atmosphere supports clients’ stabilization and recovery. The shelter offers short-term (2-14 days) intensive support services at approximately one-third the cost of hospitalization. The shelter is staffed 24 hours a day, seven days a week with professional residential crisis specialists who work with the Department of Behavioral Health, medical and psychiatric providers and case managers to support residents.', '957585009039168', 'https://sampleorg.org', 'sample@sample.org', 'Verified', '878986697513222,929094559121639', 'Call screening line (555) 555-3517 to begin application. To be eligible, you must be\r\n- Age 18 or older\r\n- Experiencing a psychiatric crisis\r\n- Must be able to maintain safety of self or others\r\n- Must not be in need of medical detoxification or other inpatient care', NULL, NULL, NULL, NULL, '1346383381421900,', NULL, '', '866965462945330', '1348528510348792', NULL, NULL, NULL, NULL, '2020-07-01 05:26:43', '2020-10-12 22:52:37'),
(94, 626861523724993, 'Supported Independent Living', NULL, '906742630902911', 'Your Community Center owns and leases apartments and condominiums throughout the city for our residents who can thrive without 24-hour care as they reintegrate into the community. The Supported Independent Living Program is the last step before total independence. Residents live on their own or with roommates in a shared apartment environment with continuing monitoring and support from our Life Skills Trainers. Staff provide weekly coaching, counseling support and skills training, focusing on mastering basic skills that will ease their transition toward self-sufficiency and successful independent living.', '', 'https://sampleorg.org', NULL, 'Verified', '637158405241810,929094559121639', 'Referrals are accepted from the Department of Behavioral Health, Local Service Agencies, private providers, hospitals and families.\r\n\r\nPrivately-paying residents need a psychiatrist who can include Your Community Center in the resident’s treatment plan and thereby provide a referral to the center. Privately paying residents can come from outside the city and must demonstrate proof of their ability to pay.\r\n\r\nResidents who require financial assistance must show proof of residency, be enrolled with the Department of Behavioral Health (with an eCura Number) and have a recommendation from their Core Service Agency to apply to the Center and have access to public funding assistance. The Core Service Agency will provide the resident all necessary documentation.\r\n\r\nThe cost for residents are determined on a sliding scale, including fees, skills training and clinical support services. For more information about how to enter our Supported Independent Living Apartment Program, please contact:', NULL, NULL, NULL, NULL, '1346383381421902,', NULL, '1328428091308059', '', NULL, NULL, NULL, NULL, NULL, '2020-07-01 05:26:44', '2020-10-12 22:56:43'),
(195, 748118421956392, 'DEAF AND HEARING OUTREACH CENTER, FAMILY MATTER OF GREATER WASHINGTON', 'DHOC', '597291118069880', 'Provides Deaf & Hard of Hearing services', '1295023062659721', 'http://familymattersdc.org/services/deaf-and-hard-of-hearing/', 'infi@testserving.com', 'Verified', '535512457471607', 'Short', '3 hours', '$40', 'HSCPD', 'Level 2, Level 3', '1346383381421910,', NULL, '1215015803426176', '1193549839853778,866965462945330,1178794928615970', '621335851884833', NULL, NULL, NULL, NULL, '2020-07-01 05:26:46', '2020-10-14 15:18:16'),
(226, 810517634677025, 'Business & Information Technology Program', NULL, '597291118069880', 'Our Administrative Support certification is a great first step towards any entry-level office support position. Learn to navigate computer software, as well as e-mail, the internet, and social media platforms.\r\n\r\nCourse Tracks Under Administrative Support:\r\nBasics for Computer: Learn to demonstrate basic computer skills for home and work. You will learn to navigate programs including Microsoft Office Word, Excel, and PowerPoint. Also gain skills to confidently navigate the Internet, E-mail, and social media platforms. This track provides the tools you need to take online exams and assessments with ease.\r\n\r\nMicrosoft Office Specialist: Get the most out of Microsoft Office to advance in any office environment. A Microsoft Office Specialist (MOS) certification in programs such as Word, Excel, or PowerPoint is a good fit for unemployed or under employed entry-level professionals.', '', 'https://www.samplewebsite.org', 'sample@sample.org', 'Verified', '789038541797078,970915508638448', 'The application is available online on the program website. You can also call for more information.', NULL, NULL, NULL, NULL, '1346383381421905,', NULL, '', '836091364973509', '1330181492619505', NULL, NULL, NULL, NULL, '2020-07-01 05:26:46', '2020-10-15 05:01:47'),
(277, 799762672906525, 'COMMUNITY FAMILY LIFE SERVICES', NULL, '786390431879533', 'program offers housing up to two-years, with 13 individual units, offering a stable and supportive housing program. These spacious one, two and three-bedroom, private apartments are available to help families escape homelessness and enable each family group to work towards independence and self-sufficiency.', '1266854743896634', 'http://www.sample.org', NULL, NULL, '929094559121639,1274117384930254', NULL, NULL, NULL, NULL, NULL, '', NULL, '', '1193549839853778', '967673170995278', NULL, NULL, NULL, NULL, '2020-07-01 05:26:47', '2020-10-12 23:21:47'),
