(401, 914835976451142, 'HIV & STD Prevention', NULL, '925360037107607', 'A preventative health care program offering primary and secondary prevention skills building groups; peer-based support groups.', '536496426622681,946396771118356', NULL, NULL, 'Sample', '', NULL, '30 minut3', 'No fee', NULL, NULL, '1346383381421904,', NULL, '1328428091308059', '998189789977161,836091364973509', '1348528510348795', NULL, NULL, NULL, NULL, '2020-07-01 05:26:49', '2020-10-13 15:20:22'),
(464, 920973469831730, 'Green Corps Training Program', NULL, '640186123610411', 'The Green Corps training program is an umbrella for citywide service & entry level workforce development in urban forestry, storm water mitigation, green infrastructure, urban agriculture & related fields. Green Corps provides a gateway to 50 different green career tracks in urban and community forestry and forest-based ecosystem and watershed restoration. The vast majority of Green Corps trainees come to the program with a record of previous incarceration.\r\n\r\nIn partnership with the Department of Energy and the Environment, the US Forest Service, and the Urban Forestry Administration, Green Corps recruits seasonal cohorts of up to 8 trainees to take part in an 8-week training program aimed at addressing core urban and community forestry needs by: expanding and sustaining the urban tree canopy; remediating storm water runoff; and restoring natural habitats within the city.  This training program provides trainees with valuable job skills, self confidence, contacts/resources for job placement, and mentoring.  Each selected trainee commits to at least 20 hours/week over the course of the program.', '1133664511724903', 'http://samplewebsite.org', 'sample@sample.org', 'Verified', '970915508638448', 'Application is available on the website. Call or email for questions.', NULL, NULL, NULL, NULL, '1346383381421899,', '1186410017519358,976209607538308', '', '', '906270690131919', NULL, NULL, NULL, NULL, '2020-07-01 05:26:50', '2020-10-12 22:46:53'),
