(536, 1007199538654431, 'Heart & Soul', NULL, '640186123610411', 'Parks & People’s Heart & Soul program aims to educate people about the benefits of healthy living habits for ourselves and our environment. We promote city-wide park-based health and learning through:\r\n\r\n- Jazzercise, African dance, and other dance and movement programs\r\n- Community Health Walks\r\n- Healthy Living cooking and Eat Smart nutrition classes\r\n- Bike repair, bike rides, and trail patrol\r\n- Girls on the Run, Family Fun Fridays, Sports Saturdays, and other youth athletics\r\n- and a wide range of programs to enliven the park as a hub of healthy physical activity and wellness.', '1052806219928789,1133664511724903', 'https://samplewebsite.com', NULL, 'Verified', '789038541797078,832990803111047,941516382466411', 'Visit website for calendar of events.', NULL, NULL, NULL, NULL, '1346383381421899,1346383381421899,', '1186410017519358,976209607538308', '', '', '1108569071838139', NULL, NULL, NULL, NULL, '2020-07-01 05:26:51', '2020-10-12 22:48:34'),
(703, 1124462892366916, 'HIV Care Management', NULL, '925360037107607', 'This service implements core programs such as: family-centered case management services; peer outreach; comprehensive risk counseling services; HIV counseling, testing and referral services (CTR)', '946396771118356', NULL, NULL, 'Verified', '1108247633295578', NULL, NULL, NULL, NULL, NULL, '1346383381421904,', NULL, '', '1222973168897685', '1134563231552544', NULL, NULL, NULL, NULL, '2020-07-01 05:26:54', '2020-10-13 15:22:02'),
(719, 1124787894447866, 'Home Repair Services', NULL, '1183850219079477', 'We provides free health and safety repairs to low-income homeowners.\r\n\r\nSome health and safety repairs addressed include: roof repair, plumbing repair, electrical repair, pest control, drywall repair, broken appliance replacement, and accessibility services.\r\n\r\nWe work on a limited number of homes each year and we want our repairs to affect as many people as possible. When considering applications, prioritizes multigenerational households and families with children.', '888398891117437', 'http://sampleorg.org', NULL, 'Verified', '929094559121639', 'If you are interested in applying to our Single Family Home Repair Program, call our office. We do our repairs in a two cycles. The application deadline is summer for fall repairs and December 1st for spring repairs. There is no harm in applying in between our deadlines, we just ask for your patience in hearing from us.\r\n\r\nAfter completing your application, we staff will review it. We may schedule an appointment to inspect your home and determine the scope of work. Further inspections from our construction manager and estimates from skilled workers may occur. After these steps, the price and content of repairs will be evaluated, and accepted homeowners will be notified.\r\n\r\nHomeowners that are accepted into the program, and a majority of adults living in their household, must attend mandatory, free Homeowners Workshops. These workshops are open to the public and are held twice a year. Attendees learn tricks of home maintenance, budgeting skills, and more. To find out more about these workshops, please contact us.', NULL, NULL, NULL, NULL, '1346383381421905,', '1221091850952095', '1328428091308059', '1009160981885425,1294818681778567', '851682919843426', NULL, NULL, NULL, NULL, '2020-07-01 05:26:54', '2020-10-13 15:19:04'),
(784, 1229115016596631, 'Support House', NULL, '906742630902911', 'Support House, the center of Your Community Center program, has helped thousands of men and women achieve stability and reintegrate into the community. \r\n\r\nSupport House offers a warm, caring environment for men and women working toward recovery and greater independence.  It is centrally located near public transportation, stores, restaurants and recreational activities (within walking distance of the Zoo). Residents receive full room and board, as well as individualized assessment, support and life skills training. Support House provides housing for up to 20 residents and is professionally staffed 24 hours, seven days a week.', '', 'https://sampleorg.org', 'sample@sample.org', NULL, '929094559121639', 'Referrals are accepted from the Department of Behavioral Health, Local Service Agencies, private providers, hospitals and families.\r\nPrivately-paying residents need a psychiatrist who can include the Center in the resident’s treatment plan, providing a referral for application to the Center. Residents also need to show proof of their ability to pay. Privately-paying residents can come from outside the city.\r\n\r\nResidents who require financial assistance must show proof of residency, be enrolled with the Department of Behavioral Health (with an eCura Number) and have a recommendation from their Local Service Agency to apply to the Center and have access to public funding assistance. The Local Service Agency will inform them of any needed documentation that they require. After documentation is gathered, please contact Support House to receive more information and to set up an initial interview.\r\n\r\nBecoming a resident of Support House includes housing, meals, 24 hour residential supervision and comprehensive skills training and clinical support services. Please contact Support House for more information.', NULL, NULL, NULL, NULL, '1346383381421903,', NULL, '1328428091308054,1328428091308059', '', '1348528510348793', NULL, NULL, NULL, NULL, '2020-07-01 05:26:55', '2020-10-12 22:59:07'),
(812, 1237806236278461, 'Education, Outreach & ParkArts', NULL, '640186123610411', 'Residents learn and experience the value of parks for community health and vitality. Youth and adults of all ages explore our greenways and blueways through expeditionary learning and outdoor education activities year-round. Visitors to our  Parks Center learn about the urban greening movement and our approach to park-based community health.\r\n\r\nThe program offers residents a performing arts pop-up program that brings together arts partners and the public for a free mobile outdoor interactive arts and cultural experience in underserved parks and green spaces.', '938406735971229', 'https://samplewebsite.com', NULL, 'Verified', '789038541797078', 'Visit website for calendar of events.', NULL, NULL, NULL, NULL, '1346383381421899,', '1099909899297811', '', '', '838941505712500', NULL, NULL, NULL, NULL, '2020-07-01 05:26:55', '2020-10-12 22:47:41'),
(848, 1229834582759480, 'Senior Services', NULL, '597291118069880', 'Our services currently include the following:\r\n\r\n– monthly grocery deliveries\r\n– weekly farmers market produce deliveries in the summer and fall\r\n– shopping transportation\r\n– friendly visits\r\n– Thanksgiving food basket deliveries\r\n– holiday gift deliveries and visits\r\n– emergency food deliveries\r\n– emergency cleaning\r\n– advocacy w/ agencies and landlords', '1300302103708266', 'https://www.EldercareOrganization.org', NULL, 'Verified', '637158405241810', 'Call for more information.', NULL, NULL, NULL, NULL, '1346383381421906,', NULL, '1328428091308059', '854808174954754', '962322435473993', NULL, NULL, NULL, NULL, '2020-07-01 05:26:56', '2020-10-13 15:19:47'),
(887, 1258855549014937, 'Homeowner Accessibility Services', NULL, '1183850219079477', 'If you are a homeowner who needs accessibility modifications built at your home for yourself or a family member, please contact us. Yachad can make accessibility renovations to the inside or outside of your home including but not limited to:\r\n\r\nHand bar installation\r\nGrab bar installation\r\nInstallation of handicap approved appliances and utilities\r\nRamp construction\r\nWe also have funding for renovations concerning disabilities such as asthma or allergies. This can include:\r\n\r\nRemoval of old, dirty carpet\r\nReplacement with new flooring', '888398891117437', 'http://sampleorg.org', NULL, 'Verified', '929094559121639', 'We base our services on financial need and project scope, and work with homeowners who do not have the resources to pay for the costly renovations. Contact us for an application. We ask for proof of homeownership and current property tax records. If you are a long-term renter, we may be able to assist you if the landlord provides his permission.\r\n\r\nAfter we receive your application, staff will schedule an appointment to meet with you to determine what is appropriate for your home modification.\r\n\r\nIf you have any questions, please contact us. We would love to hear from you.', NULL, NULL, NULL, NULL, '1346383381421905,', '1221091850952095', '1328428091308059', '1009160981885425,1294818681778567', '851682919843426', NULL, NULL, NULL, NULL, '2020-07-01 05:26:56', '2020-10-13 15:18:56'),
(925, 1318218238602449, 'Community Harvest', NULL, '640186123610411', 'The Community Harvest program provides demonstration opportunities for public land reclamation, green planning and design, job training, volunteer support, and advocacy for community greening efforts.', '793256928193231,1133664511724903', 'https://washingtonparks.net/programs/community-harvest/', NULL, 'Verified', '789038541797078,832990803111047,970915508638448', 'Call for more information.', NULL, NULL, NULL, NULL, '1346383381421898,', '1186410017519358,976209607538308,1159408019708687,916456272581834', '', '', '906270690131919', NULL, NULL, NULL, NULL, '2020-07-01 05:26:57', '2020-10-12 22:45:50'),
(943, 1301959132503150, 'Women\'s Group', NULL, '925360037107607', 'Our case management services are a part of a comprehensive family-centered program that provides peer support, creates connections between careseekers and caregivers, and promotes the participation and empowerment of women, their families, and members of their support network in developing care plans based on their self-defined needs. We accept, as well as provide, referrals for women, women and their children, to/from other programs that provide local primary medical care, support and mental health services for women with HIV/AIDS either currently not in a system of care or who need support to remain in a system of care. We provide services for women and their families that assists them in accessing respite care, childcare, housing, food, transportation services, etc., providing women with opportunities to take care of not only their own primary medical and psychosocial needs but also the needs of their children and other family members.', '946396771118356', 'www.womenscollective.org', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '', NULL, '1328428091308059', '', '1134563231552544', NULL, NULL, NULL, NULL, '2020-07-01 05:26:57', '2020-10-13 15:20:44'),
